import React from 'react'
import toggleIconDecorator from '../decorators/toggleIconDecorator'
import addArticleIcon from '../create-article.svg'

const ToggleCreate = ({ toggleAnimation, padding, transformL, transformR, opacity } ) => {


	return(
		<button className="icon-style"
				onClick={ toggleAnimation }
				style={{padding: padding}}
		 >


		  <div style={{opacity:opacity}}>
			<img src={addArticleIcon} className='icon-style'  alt="search-icon" />
		  </div>

		</button> 

	)

}
export default ToggleCreate
